<!DOCTYPE html>
<html>
<head>
  <title>Pics Harbour 1.0.0 - API Documentation</title>
  <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/swagger-ui/4.13.0/swagger-ui.css" />
  <script src="https://cdnjs.cloudflare.com/ajax/libs/swagger-ui/4.13.0/swagger-ui-bundle.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/swagger-ui/4.13.0/swagger-ui-standalone-preset.js"></script>
</head>
<body>
  <div id="swagger-ui"></div>
  <script>
    window.onload = function() {
      // Build a system
      const ui = SwaggerUIBundle({
        url: "./swaggerStatic.json",
        dom_id: '#swagger-ui',
        deepLinking: true,
        presets: [
          SwaggerUIBundle.presets.apis,
          SwaggerUIStandalonePreset
        ],
        plugins: [
          SwaggerUIBundle.plugins.DownloadUrl
        ],
        layout: "StandaloneLayout"
      })
      window.ui = ui
    }
  </script>
</body>
</html>
